import React from "react";


function About() {

    const containerStyle = {
        display: 'flex',
        justifyContent: 'space-between',
        backgroundColor: 'white',
        color: 'white',
        padding: '10px',
        textAlign: 'center',
    };

    return (
        <div className= { containerStyle}> 

        <h1 className= { containerStyle}>About Me</h1>

        </div>
    );

}

export default About;
